import React from "react";

const Dropdown = () => {
  return (
    <div className="relative p-5 w-full max-w-[400px]">
      <div
        className="p-5 border border-gray-200
        rounded-lg w-full cursor-pointer
      "
      >
        selected
      </div>
      <div
        className="border border-gray-200 
      absolute top-full left-0 w-full
      rounded-lg"
      >
        <div className="p-5">Javascript</div>
        <div className="p-5">vuejs</div>
        <div className="p-5">react</div>
      </div>
    </div>
  );
};

export default Dropdown;
